import Navigation from './Navigation';
import styled from 'styled-components';

const Layout = props => {
  return (
    <LayoutContainer>
      <Navigation />
      {props.children}
    </LayoutContainer>
  );
};

const LayoutContainer = styled.div`
  color: red;
  margin: 1%;
  padding: 1%;
  border: 1px solid #ddd;
`;

const layoutStyle = {};

export default Layout;
